public int compare(
    TimelineDomain domain1, TimelineDomain domain2) {
   int result = domain2.getCreatedTime().compareTo(
       domain1.getCreatedTime());
   if (result == 0) {
     return domain2.getModifiedTime().compareTo(
         domain1.getModifiedTime());
   } else {
     return result;
   }
}
